Convert the following code:
<pre>
  if (condition) x = expr1;
  else x = expr2;
</pre>
To:
<pre>
  x = condition ? expr1 : expr2;
</pre>

Convert the following code:
<pre>
  var x = expr1;
  if (x = null) x = expr2;
</pre>
To:
<pre>
  var x = expr1 ?? expr2;
</pre>

Convert the following code:
<pre>
  if (condition) return expr1;
  return expr2;
</pre>
To:
<pre>
  return condition ? expr1 : expr2;
</pre>

Suggest to replace
            bool result = x > 0;
            if (y > 0) result = true;
            To
            bool result = x > 0 || y > 0;

Check for inequality before assignment is redundant
<pre>
  if (x != value)
    x = value;
</pre>

Redundant default switch branch:
<pre>
  switch (foo)
  {
    case Bar:
      DoSomething;
      break;
    default: // here
      break;
  }
</pre>

